import { lazy, Suspense } from "react";
import { GlobalStyle } from "./globalStyles";
// let's import all the components
// we will use lazy to import all components

const Home = lazy(() => import("./Pages/Home") );

function App() {
  return <>
  
  <Suspense fallback={null}>
  <GlobalStyle />
  Hi There!
  </Suspense>
  
  </>;
}

export default App;
